let newTeamContext;

class PageNewTeam {

  playerObjects;
  imageData;

  constructor(app) {
    this._app = app;
    newTeamContext = this;
    this.playerObjects = new Array();
  }

  async show() {
    let html = await fetch("pages/newTeam.html");
    let htmlContent = "";
    if (html.ok) {
      htmlContent = await html.text();
    }
    this._app.setPageContent(htmlContent);

    $("#alertBox").hide();
    this.players = $("#players");
    $("#addNewPlayer").on("click", this.submitPlayer);
    $("#submitTeam").on("click", this.submitTeam);

    // Setup the image input listener
    $("#inputfile").change(function(){
        newTeamContext.readImage(this);
    });
  }

  submitPlayer() {
    if ($("#newPlayerName").val().length < 2) {
      $("#alertBox").show();
      $("#faultyElement").html("Gamertag");
      return;
    }
    if ($("#newPlayerSR").val() < 0 || $("#newPlayerSR").val() > 5000) {
      $("#alertBox").show();
      $("#faultyElement").html("Skill Rating");
      return;
    }

    // Add objects of player to playerobjects
    newTeamContext.playerObjects.push({
      name: $("#newPlayerName").val(),
      sr: $("#newPlayerSR").val(),
      captain: $("#newPlayerCaptain").val()
    });

    console.log(newTeamContext.playerObjects);

    // Generate card for saved player
    let player = $('<div class="card col-sm-4">' +
    '<div class="card-body">' +
        '<div class="row">' +
            '<div class="col-lg">' +
              '<span>Gamertag: </span>' +
            '</div>' +
            '<div class="col-lg">' +
            '<b>' + $("#newPlayerName").val() +'</b>' +
            '</div>' +
          '</div>' +
          '<div class="row">' +
              '<div class="col-lg">' +
                  '<span>Skill rating: </span>' +
              '</div>' +
              '<div class="col-lg">' +
                  '<b>' + $("#newPlayerSR").val() + '</b>' +
              '</div>' +
          '</div>' +
          '<div class="row">' +
              '<div class="col-lg">' +
                  '<span>Captain? </span>' +
              '</div>' +
              '<div class="col-lg">' +
                  '<b>' + $("#newPlayerCaptain").val() + '</b>' +
              '</div>' +
          '</div>' +
      '</div>' +
  '</div>').appendTo("#players");

    // reset newPlayer Card
    $("#newPlayerName").val("")
    $("#newPlayerSR").val("")
    $("#newPlayerCaptain").val("No")
  }

  async submitTeam() {
    if ($("#teamName").val() == "") {
      $("#faultyElement").html("Team name");
      $("#alertBox").show();
      setTimeout(function() { $("#alertBox").hide(); }, 5000);
    } else if (newTeamContext.playerObjects.length < 6) {
      $("#faultyElement").html("The number of players");
      $("#alertBox").show();
      setTimeout(function() { $("#alertBox").hide(); }, 5000);
    } else {
      let numberOfPlayers = 0;
      let avgSr = 0;
      newTeamContext.playerObjects.forEach(player => {
        numberOfPlayers++;
        console.log(player.sr);
        avgSr += parseInt(player.sr, 10);
      });
      avgSr = avgSr / numberOfPlayers;
      let teamref = database.ref('teams/').push({
        avgRating: Math.round(avgSr),
        name: $("#teamName").val()
      });
      database.ref('teams/' + teamref.key).update({
        id: teamref.key
      });
      if (newTeamContext.imageData == null) {
        database.ref('teams/' + teamref.key).update({
          logo: "data:image/jpeg;base64,"
        });      
      } else {
        database.ref('teams/' + teamref.key).update({
          logo: newTeamContext.imageData
        });
      }
      newTeamContext.playerObjects.forEach(player => {
        database.ref('teams/' + teamref.key +'/players').push({
          name: player.name,
          sr: player.sr,
          captain: player.captain
        });
      });
      console.log("Written to database");
      await newTeamContext._app._instances["/teams"].updateTeams();
      location.hash = "/teams";
    }
  }

  readImage(input){
    if (input.files && input.files[0]) {
      let reader = new FileReader();
      reader.onload = function(e){
        var i = new Image();
        i.src = e.target.result;
        i.onload = function(){
          $('#thumbnail').attr('src', e.target.result);
          let width = i.width;
          let height = i.height;
          console.log(width);
          console.log(height);
          console.log(width/height);
          let ratioCheck = (width/height == 16/9);
          if(ratioCheck) {
            newTeamContext.imageData = e.target.result;
          } else {
            $("#faultyElement").html("Image ratio has to be 16:9. Current image");
            $("#alertBox").show();
            setTimeout(function() { $("#alertBox").hide(); }, 10000);
            $('#thumbnail').attr('src', '');
            $('#inputfile').val(null);
          }
        };
        $('#thumbnail').attr('style', "display=block;");
      }
      reader.readAsDataURL(input.files[0]);
    }
  }
}